import Container from '@mui/material/Grid';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';



export function AboutMeFolderGroup(){
    function handleClick(){
        //instead of alert, change it to highlight the container and open popup tab
        alert("you clicked me!")     
    }
    return(
        <Container className='Container-Properties' onClick={handleClick}>
            <Foldericon></Foldericon>
            <FolderText></FolderText>
        </Container>
    )
} 

export function Foldericon(){
    return(
        <img src='https://win98icons.alexmeub.com/icons/png/directory_closed_cool-3.png'
        className='Folder-icon'
        alt='Folder icon'
        />
    )
}

export function FolderText(text){
    text = "About Me"
    return(
        <p className='FolderText'>
            {text}
        </p>
    )
}

export function Notification() {
    return (
        <div>
            <h4>Popup - GeeksforGeeks</h4>
            <Popup trigger=
                {<button> Click to open modal </button>} 
                modal nested>
                {
                    close => (
                        <div className='modal'>
                            <div className='content'>
                                Welcome to GFG!!!
                            </div>
                            <div>
                                <button onClick=
                                    {() => close()}>
                                        Close modal
                                </button>
                            </div>
                        </div>
                    )
                }
            </Popup>
        </div>
    )
};
